import React from 'react';
import './App.css';
import Home from './Views/Home';
import { BrowserRouter as Router, Route } from 'react-router-dom';
import Landing from './Views/Landing';
function App() {
  return (
    <Router>
      <div className="App">
        <Route estrict path='/' component={Landing } />
        <Route estrict path='/home' component={Home } />
      </div>
    </Router>
  );
}

export default App;
